// import { QuestionResponse } from '../types/domains/QuestionResponse';
export class QuestionResponse {
  userId: string;
  questionId: number;
  multiOptionIds: number[] | null;

  singleOptionId: number | null;
  shortAnswer: string | null;
  type: string;

  constructor(data: Map<string, any>) {
    this.userId = data.get("user_id");
    this.questionId = data.get("question_id");
    this.multiOptionIds = data.get("multi_option_ids");
    this.singleOptionId = data.get("single_option_id");
    this.shortAnswer = data.get("short_answer");
    this.type = data.get("type");
  }
}
